const About = () => {
    return (
        <section id="about">
            <div className="info" >
                <p>Hi. My name is Jonathan Nguyen. I am currently a student at</p>
                <p>the University of California, Santa Cruz. My field of study is Computer</p>
                <p>Science</p>
            </div>
            <img className="image" src="" alt="image of myself"/>
        </section>
    )
}

export default About
